import {  Typography } from '@material-ui/core';
import terrabot1 from '../files/Terabot1.png';
export default function Terabot(){
    return(
        <div style={{'margin-top':'50px', 'text-align': 'left'}}>
            <Typography variant="h5" style={{ 'margin-left':'5%'}}>
                Terabot
            </Typography>
            <Typography variant="h6" style={{ 'margin-left':'5%','margin-top':'2%' }}>
            The goal of this project was to design, development and manufacturing a prototype of a sophisticated 
            mechanism capable of functioning in constrained and harsh terrain region consisting of electromagnetic and gripper arms.
            </Typography>

            <img src={terrabot1} style = {{'width':'30%', 'height':'30%', 'margin-left':'30%'}} />

        </div>
    );
}
